import React from "react";
import { Breadcrumbs } from "../../../components/pageSpecific/brochure/PageTitle";
import styled from "styled-components";

const core = () => {
  return (
    <Container>
      <Breadcrumbs />
    </Container>
  );
};

const Container = styled.div`
  display: grid;
`;

export default core;
